import { MapContainer, TileLayer, ScaleControl } from 'react-leaflet';
import tileLayer from '../util/tileLayer';

const center = [52.22977, 21.01178];

const MapWrapper = () => {
  return (
    <MapContainer
      center={center}
      zoom={18}>

      <TileLayer {...tileLayer} />

      <ScaleControl imperial={false} />

    </MapContainer>
  )
}

export default MapWrapper;
